import React from 'react';

import ArgosLogo from '../../Assets/Images/argoslogo.png';
import classes from './Logo.module.css';

const Logo = (props) => (
    <img src={ArgosLogo} className={classes.Logo} alt="Argos Logo" />
);

export default Logo;
